import React from 'react';
import styled from '@emotion/styled';

const Head = styled.header`
    background-color: green;
    padding: 20px;
    font-size: 20px;
    margin-bottom: 20px;
`;

const Header = () => {
    return ( 
        <Head>
            <p>Header</p>
        </Head>
     );
}

export default Header;
